// import { useDispatch } from "react-redux";



import Home from "./Home";
import Detail from "./Detail";
import Header from "./Header";


function App() {

  return ( 

    <div className="App">
      <Header />
      <Container>
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/page" exact component={Detail} />
        </Switch>
      </Container>
    </div>

  );
}

